	export let d3 = '0';

	// Планетарна грамотність
	export let p5 = '0';

	let birthdate = '';
	let name = '';
	let calculatedName = '';
	let age = null;
	let errors = {};

	const calcNumber = (number) => {
		if (number > 22) {
			const res = String(number).split('');
			let sum = 0;
			res.forEach((elem) => {
				sum += Number(elem);
			});
			return calcNumber(sum);
		} else {
			return number;
		}
	};

	function calculateAge(birthDate) {
		const today = new Date();
		const birth = new Date(birthDate);

		let age = today.getFullYear() - birth.getFullYear();
		const monthDifference = today.getMonth() - birth.getMonth();

		if (monthDifference < 0 || (monthDifference === 0 && today.getDate() < birth.getDate())) {
			age--;
		}

		return age;
	}

	const handleSubmit = (event) => {
		event.preventDefault();

		if (birthdate === '') {
			errors = { birthdate: 'Будь ласка оберіть вашу дату народження' };

			return;
		}

		const [day, month, year] = birthdate.split('.');

		age = calculateAge(birthdate);

		calculatedName = name;

		a = calcNumber(Number(day));
		b = calcNumber(Number(month));
		c = calcNumber(Number(year));
		d = calcNumber(a + b + c);
		e = calcNumber(a + b + c + d);
		a1 = calcNumber(a + e);
		a2 = calcNumber(a + a1);
		b1 = calcNumber(b + e);
		b2 = calcNumber(b + b1);
		c1 = calcNumber(c + e);
		c2 = calcNumber(c + c1);
		d1 = calcNumber(d + e);
		d2 = calcNumber(d + d1);
		f = calcNumber(a + b);
		g = calcNumber(b + c);
		y = calcNumber(c + d);
		k = calcNumber(d + a);
		s1 = calcNumber(f + e);
		s2 = calcNumber(f + s1);
		p1 = calcNumber(g + e);
		p2 = calcNumber(g + p1);
		s4 = calcNumber(y + e);
