										class="shrink-0 bg-white border border-slate-300 p-2 w-14 h-14 flex justify-center items-center rounded-full"
									>
										<span class="font-bold">{c5}</span>
									</div>
								</div>
							</div>
							<ChevronDown classes="-rotate-90 w-9 h-9" />
							<div
								class="shrink-0 bg-white border border-slate-300 p-2 w-14 h-14 flex justify-center items-center rounded-full"
							>
								<span class="font-bold">{c6}</span>
							</div>
						</div>
					</div>

					<!-- Духовна грамотність -->
					<div class="border border-slate-300 p-9 rounded-3xl overflow-hidden">
						<h2 class="mx-auto max-w-4xl text-center text-2xl font-bold tracking-tight">
							Духовна грамотність
						</h2>
						<div class="mt-14 flex items-center justify-around text-lg w-10/12 mx-auto">
							<div
								class="bg-white border border-slate-300 p-2 w-14 h-14 flex justify-center items-center rounded-full"
							>
								<span class="font-bold">{d3}</span>
							</div>
						</div>
					</div>

					<!-- Планетарна грамотність -->
					<div class="border border-slate-300 p-9 rounded-3xl overflow-hidden">
						<h2 class="mx-auto max-w-4xl text-center text-2xl font-bold tracking-tight">
							Планетарна грамотність
						</h2>
						<div class="mt-14 flex items-center justify-around text-lg w-10/12 mx-auto">
							<div
								class="bg-white border border-slate-300 p-2 w-14 h-14 flex justify-center items-center rounded-full"
							>
								<span class="font-bold">{p5}</span>
							</div>
						</div>
					</div>
				</div>
			</div>
		{/if}
	</div>
	{#if age}
		<div class="flex justify-center mt-14">
			<button
				on:click={toggleContent}
				aria-label={showContent ? 'Приховати контент' : 'Розгорнути контент'}
				type="button"
				class="relative inline-flex items-center justify-center px-7 py-3 overflow-hidden
				    text-orange-400 rounded-md border border-orange-400 focus:shadow-custom group w-52"
			>
				<span
					class="absolute w-0 h-0 transition-all duration-300 ease-out bg-orange-400 rounded-full group-hover:w-56 group-hover:h-56"
				></span>
				<span class="absolute inset-0 w-full h-full -mt-1 rounded-lg opacity-30"></span>
				<span class="relative transition-all duration-300 group-hover:text-white"
					>{showContent ? 'Приховати' : 'Розгорнути'}</span
				>
			</button>
		</div>
	{/if}
</section>
